import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import JSXElement from './jsxElement.js';
import FormMessage from './formMessage.js';
import NavigationBar from './navigationBar';
import LikeButton from './like_unlike.js';
import Timer from './timer.js';

const data = {
  buttonInfo: {
    loginButtonText: 'Login',
    signupButtonText: 'Sign Up',
    loginCustomText: 'You have clicked Login button',
    signupCustomText: 'You have clicked SignUp button',
  },
  links: {
    google: {
      text: "Google",
      url: "https://www.google.com/",
    },
    react: {
      text: 'React',
      url: 'https://reactjs.org/',
    }
  },
  icon: {
    likedIconUrl: 'https://i.imgur.com/6cjqKy3.png', 
    unlikedIconUrl: 'https://i.imgur.com/DYHVKQm.png',
  }

};

ReactDOM.render(
  <App data={data}/>,
  document.getElementById('my-jsx-element')
);

class App extends React.Component {
  render() {
    return (
      <div>
        <NavigationBar links={this.props.data.links}/>
        <JSXElement buttonInfo={this.props.data.buttonInfo}/>
        <FormMessage />
        <LikeButton icon={this.props.data.icon}/>
        <Timer />
      </div>
    );
  }
}

export default App;
